
        
  const { registerBlockType } = wp.blocks;
  const { RichText, MediaUpload, InspectorControls } = wp.blockEditor;
  const { Panel, PanelBody, PanelRow, TextareaControl } = wp.components;


        registerBlockType('wp/branded-with-background-image', {
            title: 'branded with background image',
            icon: (<img src="data:image/jpeg;base64," />),
            category: 'common',
            attributes: {
  "contentBWG": {
    "type": "string",
    "default": "Get in touch"
  },
  "contentlbo": {
    "type": "string",
    "default": "Mattis amet hendrerit dolor, quisque lorem pharetra. Pellentesque lacus nisi urna, arcu sociis eu. Orci vel lectus nisl eget eget ut consectetur. Sit justo viverra non adipisicing elit distinctio."
  },
  "backgroundurlpGd": {
    "attribute": "src",
    "type": "string",
    "selector": "img",
    "default": vars.url+'photo-1525130413817-d45c1d127c42.jpeg'
  },
  "backgroundaltGNm": {
    "attribute": "alt",
    "type": "string",
    "selector": "img",
    "default": ""
  }
},
            edit(props) {
            const { attributes, setAttributes } = props;

            return (
                <div>
                    <InspectorControls>
                    
    <Panel>
      































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































































              
      <PanelBody title="Background Image">
        <PanelRow>
          <div>
            <MediaUpload
              onSelect={ (media) => { 
                setAttributes({ 
                  backgroundurlpGd: media.url,
                   backgroundaltGNm: media.alt
                }); 
              } }
              type="image"
              value={ attributes.backgroundurlpGd }
              render={({ open }) => (
                  <button onClick={ open }>Select Image</button>
              )}
            />
            {attributes.backgroundurlpGd && (
                <img src={attributes.backgroundurlpGd} alt={attributes.backgroundaltGNm} />
            )}
          </div>
        </PanelRow>
      </PanelBody>
      
    </Panel>
                    </InspectorControls>

                    <div>
    <div>
        <div className="relative bg-indigo-800">
            <div className="absolute inset-0">
                <img className="w-full h-full object-cover" src={attributes.backgroundurlpGd} alt={attributes.backgroundaltGNm}/>
                <div className="absolute inset-0 bg-indigo-800 mix-blend-multiply" aria-hidden="true"/>
            </div>
            <div className="relative max-w-7xl mx-auto py-24 px-4 sm:py-32 sm:px-6 lg:px-8">
                 <h1 className="text-4xl font-extrabold tracking-tight text-white sm:text-5xl lg:text-6xl"><RichText tagName="span" value={attributes.contentBWG} default="Get in touch" onChange={ (newtext) =>  {
        setAttributes({ contentBWG: newtext });
      }}
    /></h1>

                <p className="mt-6 text-xl text-indigo-100 max-w-3xl">
                    <RichText tagName="span" value={attributes.contentlbo} default="Mattis amet hendrerit dolor, quisque lorem pharetra. Pellentesque lacus nisi urna, arcu sociis eu. Orci vel lectus nisl eget eget ut consectetur. Sit justo viverra non adipisicing elit distinctio." onChange={ (newtext) => { setAttributes({ contentlbo: newtext }); }} /></p>
            </div>
        </div>
    </div>
</div>
                </div>
                );
            },
            save(props) {
            const { attributes } = props;

            return (
                <div>
    <div>
        <div class="relative bg-indigo-800">
            <div class="absolute inset-0">
                <img class="w-full h-full object-cover" src={attributes.backgroundurlpGd} alt={attributes.backgroundaltGNm}/>
                <div class="absolute inset-0 bg-indigo-800 mix-blend-multiply" aria-hidden="true"/>
            </div>
            <div class="relative max-w-7xl mx-auto py-24 px-4 sm:py-32 sm:px-6 lg:px-8">
                 <h1 class="text-4xl font-extrabold tracking-tight text-white sm:text-5xl lg:text-6xl"><RichText.Content value={attributes.contentBWG} /></h1>

                <p class="mt-6 text-xl text-indigo-100 max-w-3xl">
                    <RichText.Content value={attributes.contentlbo} /></p>
            </div>
        </div>
    </div>
</div>
            );
            },
        });
        